// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

// OpenZeppelin imports from Remix GitHub repository
import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/release-v4.4/contracts/access/Ownable.sol";
import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/release-v4.4/contracts/security/ReentrancyGuard.sol";
import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/release-v4.4/contracts/token/ERC20/IERC20.sol";

contract TMetisReward is Ownable, ReentrancyGuard {
    IERC20 public tmetisToken;
    uint256 public constant REWARD_AMOUNT = 5 * 10**18; // Assuming 18 decimals

    mapping(address => bool) private whitelisted;
    mapping(address => bool) private hasClaimed;
    address[] private eligibleAddresses;

    event Whitelisted(address indexed user);
    event RewardClaimed(address indexed user, uint256 amount);

    constructor(address _tmetisTokenAddress) {
        require(_tmetisTokenAddress != address(0), "Invalid token address");
        tmetisToken = IERC20(_tmetisTokenAddress);
    }

    function addToWhitelist(address _user) external onlyOwner {
        require(_user != address(0), "Invalid address");
        require(!whitelisted[_user], "Already whitelisted");

        whitelisted[_user] = true;
        eligibleAddresses.push(_user);

        emit Whitelisted(_user);
    }

    function addManyToWhitelist(address[] calldata _users) external onlyOwner {
        for (uint256 i = 0; i < _users.length; i++) {
            address user = _users[i];
            if (user != address(0) && !whitelisted[user]) {
                whitelisted[user] = true;
                eligibleAddresses.push(user);
                emit Whitelisted(user);
            }
        }
    }

    function getEligibleAddresses() external view returns (address[] memory) {
        return eligibleAddresses;
    }

    function claimReward() external nonReentrant {
        require(whitelisted[msg.sender], "Not eligible");
        require(!hasClaimed[msg.sender], "Reward already claimed");

        hasClaimed[msg.sender] = true;

        require(
            tmetisToken.transfer(msg.sender, REWARD_AMOUNT),
            "Token transfer failed"
        );

        emit RewardClaimed(msg.sender, REWARD_AMOUNT);
    }

    function emergencyWithdrawTokens(address _token, uint256 _amount) external onlyOwner {
        require(_token != address(0), "Invalid token address");
        IERC20(_token).transfer(owner(), _amount);
    }
    /// @notice Returns the tMETIS token balance of the contract
    function getContractTokenBalance() external view returns (uint256) {
        return tmetisToken.balanceOf(address(this));
}

}

